#include <iostream>
#include <fstream>
#include <sstream>
#include <string>
#include <cstdlib>
#include <cstdio>
#include <cstring>
#include <cctype>
#include <ctime>


class C_Faculdade
{
private:
	char nome[100];
	char endereco[100];
	char numero[100];
	char cidade[100];
	char estado[100];
	char cep[100];

public:
	void set(char* nome, char* endereco, char* numero, char* cidade, char* estado, char* cep);
	void print();
};

void C_Faculdade::set(char* nome, char* endereco, char* numero, char* cidade, char* estado, char* cep)
{
	strcpy_s(nome, 100, nome);
	strcpy_s(endereco, 100, endereco);
	strcpy_s(numero, 100, numero);
	strcpy_s(cidade, 100, cidade);
	strcpy_s(estado, 100, estado);
	strcpy_s(cep, 100, cep);

}

void C_Faculdade::print()
{
	std::cout << nome << " " << endereco << " " << numero << " " << cidade << " " << estado << " " << cep << std::endl;
}

int main(int argc, char* argv[])
{
	C_Faculdade faculdade;

	faculdade.set(argv[1], argv[2], argv[3], argv[4], argv[5], argv[6]);
	faculdade.print();

	return 0;
}




